import Layout from '../components/Layout'

const Contact = (props) => {
  return (
    <Layout>
      <main>
        <div className='contact-card'>
          <div className='section-title'>
            Get in Touch
          </div>
          <div className='contact-links'>
            <img className='icon' src='githubblack.svg'/>
            <img className='icon' src='linkedin.png'/>
            <img className='icon' src='linkedin.png'/>
          </div>
        </div>
      </main>

      <style jsx>{`
        .icon {
          width: 100px;
          height: 100px;
          border-radius: 100%;
        }
        .section-title {
          padding-bottom: 50px;
          text-align: center;
          font-size: 3rem;
        }
        .contact-card {
          border: 1px solid rgba(173,173,173,0.37);
          -webkit-box-shadow: 6px 6px 6px 0px rgba(173,173,173,0.67);
          -moz-box-shadow: 6px 6px 6px 0px rgba(173,173,173,0.67);
          box-shadow: 6px 6px 6px 0px rgba(173,173,173,0.67);
          padding: 50px 100px;
          padding-bottom: 100px;
          border-radius: 10px;
          width: 1100px;
          margin-left: auto;
          margin-right: auto;
          margin-bottom: 200px;
        }
        main {
          margin: 100px 50px;
        }
      `}</style>
    </Layout>
  )
}

export default Contact
